commit.message:
Allow using "surfaceName" to reference a Surface

Summary:
Add new parameter `surfaceName` when calling `ReactInstance.renderToSurface`, with this, you will be able to reference a surface from compositor by simply providing the surface name: `compositor.getSurface(name)`. This name can also be used to reference surface on React side to attach a 2d video to a surface. See the `Environment.setScreen` APIs.
We provide a function `getViewRootID` in `UIManager`, by providing tag of a view, it will return the surface name it belongs to:
```
const tag = findNodeHandle(this);
UIManager.getViewRootID(tag).then(surface => {
   // do something with the surface name
});
```

Reviewed By: MartinSherburn

